import './MiniBoxVoto.css';

export const MiniBoxVoto = () => {
  return (
    <div id="mini-box-voto">
      <img src="./img/avatar-kunlaboris.svg" width="40px" alt="cara feliz" />
      <div id="box-noticia">
        <p>
          Lorem ipsum dolor sit amet consectetur adipiscing elit, parturient himenaeos scelerisque duis dis bibendum
        </p>
        <h5 id="autor-noticia">
          <span>Autor:</span>
          <strong> Nombre Apellidos </strong>
          <span> publicado el 25/02/2020 </span>
        </h5>
      </div>
    </div>
  );
};
